import React from 'react';
import './Aridesigns.css';
import Navbar from '../Components/Navbar';

function Cards() {
  return (
    <>
    <Navbar/>
    <div className="main">
      {/* Card 1 */}
      <div className="card">
        <div className="image">
          <img src="https://upload.wikimedia.org/wikipedia/commons/thumb/8/85/Gfp-missouri-st-louis-clubhouse-pond-and-scenery.jpg/1199px-Gfp-missouri-st-louis-clubhouse-pond-and-scenery.jpg" alt="Card Image" />
        </div>
        <div className="title">
          <h1>Write title Here</h1>
        </div>
        <div className="des">
          <p>You can Add Description Here...</p>
          <button>View Profile</button>
        </div>
      </div>

      {/* Card 2 */}
      <div className="card">
        <div className="image">
          <img src="https://cdn.pixabay.com/photo/2018/01/09/03/49/the-natural-scenery-3070808_1280.jpg" alt="Card Image" />
        </div>
        <div className="title">
          <h1>Write title Here</h1>
        </div>
        <div className="des">
          <p>You can Add Description Here...</p>
          <button>View Profile</button>
        </div>
      </div>

      {/* Add more cards as needed */}

    </div>
    </>
  );
}

export default Cards;
